document.getElementById('generate-pdf-button').addEventListener('click', function () {
    const { jsPDF } = window.jspdf;

    // Initialize jsPDF with A4 format in portrait orientation
    var pdf = new jsPDF('portrait', 'pt', 'a4');

    // Base64 encoded TTF font for FontAwesome Solid and Brands
    const faSolidBase64 = getFontAwesomeSolidBase64();
    const faBrandsBase64 = getFontAwesomeBrandsBase64();

    // Add the custom FontAwesome fonts
    addFontsToPDF(pdf, faSolidBase64, faBrandsBase64);

    // Icon Unicode Map with Solid and Brands icons
    const iconUnicodeMap = getIconUnicodeMap();

    const iconYOffset = -14;

    // Reference the CV container
    const cvContainer = document.getElementById('cv-container');
    const cvName = document.querySelector('#cv-container .cv-header h1').innerText.trim();
    const scale = 0.75; // Convert pixels to points (1px = 0.75pt)

    // First, render the HTML content to the PDF
    pdf.html(cvContainer, {
        callback: function (doc) {
            handleLinksInPDF(doc, cvContainer, scale);
            handleIconsInPDF(doc, cvContainer, scale, iconUnicodeMap, iconYOffset);

            cvFooterString(doc);

            // Save the generated PDF
            const fileName = cvName ? `${cvName}-cv.pdf` : 'cv.pdf';
            doc.save(fileName);
        },
        x: 0,   // Horizontal padding
        y: 0,   // Vertical padding
        html2canvas: {
            scale: 0.75,
            useCORS: true,
            onclone: function (clonedDoc) {
                hideIconsInClone(clonedDoc);
            }
        }
    });
});

// Helper function to add FontAwesome fonts to jsPDF
function addFontsToPDF(doc, faSolidBase64, faBrandsBase64) {
    doc.addFileToVFS('FA-Solid.ttf', faSolidBase64);
    doc.addFont('FA-Solid.ttf', 'FA-Solid', 'normal');

    doc.addFileToVFS('FA-Brands.ttf', faBrandsBase64); // Add brands font
    doc.addFont('FA-Brands.ttf', 'FA-Brands', 'normal');
}

// Helper function to handle links in the PDF
function handleLinksInPDF(doc, container, scale) {
    const linkElements = container.querySelectorAll('a');

    linkElements.forEach(link => {
        const linkRect = link.getBoundingClientRect();
        const href = link.getAttribute('href');

        const pdfX = (linkRect.left - container.getBoundingClientRect().left) * scale;
        const pdfY = (linkRect.top - container.getBoundingClientRect().top) * scale;
        const pdfWidth = linkRect.width * scale;
        const pdfHeight = linkRect.height * scale;

        doc.link(pdfX, pdfY, pdfWidth, pdfHeight, { url: href });
    });
}

// Helper function to handle icons in the PDF
function handleIconsInPDF(doc, container, scale, iconUnicodeMap, iconYOffset) {
    const iconElements = container.querySelectorAll('i.fas, i.fab');

    iconElements.forEach(icon => {
        const iconRect = icon.getBoundingClientRect();
        const pdfX = (iconRect.left - container.getBoundingClientRect().left) * scale;
        const pdfY = (iconRect.top - container.getBoundingClientRect().top) * scale;

        let faClass = Array.from(icon.classList).find(cls => cls.startsWith('fa-'));
        const iconUnicode = iconUnicodeMap[faClass];

        if (iconUnicode) {
            const { r, g, b } = getIconColor(icon);  // Extract RGB values

            // Set the RGB color dynamically
            doc.setTextColor(r, g, b);

            // Set the FontAwesome font based on the icon type
            if (icon.classList.contains('fas')) {
                doc.setFont('FA-Solid');
            } else if (icon.classList.contains('fab')) {
                doc.setFont('FA-Brands');
            }

            doc.setFontSize(9); // Increase font size for better visibility
            doc.text(iconUnicode, pdfX, pdfY - iconYOffset);
        } else {
            console.warn(`No Unicode mapping found for icon class: ${faClass}`);
        }
    });
}

// Helper function to get the color of an icon and ensure the RGB values are integers
function getIconColor(icon) {
    const computedStyle = window.getComputedStyle(icon);
    const cssColor = computedStyle.color || 'rgb(0,0,0)'; // Default to black if no color is found

    return extractRGB(cssColor);
}

// Function to extract RGB values from a CSS color string and ensure they are integers
function extractRGB(color) {
    // Check if it's an RGB or hex color
    if (color.startsWith('rgb')) {
        const rgbValues = color.match(/\d+/g).map(Number);  // Extract the numbers and convert to integers
        return { r: rgbValues[0], g: rgbValues[1], b: rgbValues[2] };
    } else {
        // Handle hex color if needed
        const hex = color.replace('#', '');
        const bigint = parseInt(hex, 16);
        const r = (bigint >> 16) & 255;
        const g = (bigint >> 8) & 255;
        const b = bigint & 255;
        return { r, g, b };
    }
}

// Helper function to hide icons in the cloned document (for the PDF rendering)
function hideIconsInClone(clonedDoc) {
    clonedDoc.querySelectorAll('i.fas, i.fab').forEach(icon => {
        icon.style.visibility = 'hidden';
    });
}

// Mock icon Unicode map for testing
function getIconUnicodeMap() {
    return {
        'fa-star': '\uf005',
        'fa-heart': '\uf004',
        'fa-check': '\uf00c',
        'fa-times': '\uf00d',
        'fa-map-marker-alt': '\uf3c5',
        'fa-phone': '\uf095',
        'fa-envelope': '\uf0e0',
        'fa-linkedin': '\uf08c',
        'fa-globe': '\uf0ac',
        'fa-code': '\uf121',
        'fa-user': '\uf007',
        'fa-laptop-code': '\uf5fc'
    };
}

function cvFooterString(doc) {
    const pageHeight = doc.internal.pageSize.height;
    const bottomText = "This CV was generated using a custom WordPress plugin I developed. View the code on GitHub:";
    const githubLink = "github.com/synlock";

    // Set font size and color for the bottom text
    doc.setFont('Helvetica');
    doc.setFontSize(10);
    doc.setTextColor(0, 0, 0); // Set text color to black

    // Combine text and GitHub link on the same line
    const combinedText = bottomText + githubLink;
    const textWidth = doc.getTextWidth(combinedText); // Get the width of the full text
    const pageWidth = doc.internal.pageSize.width;    // Get page width

    // Add the combined text at the bottom of the page, centered
    doc.text(bottomText, (pageWidth - textWidth) / 2, pageHeight - 15); // Add the non-clickable text
    const linkX = (pageWidth - textWidth) / 2 + doc.getTextWidth(bottomText); // Calculate position for link

    // Set color for the clickable GitHub link
    doc.setTextColor(0, 0, 255); // Blue for link
    doc.text(githubLink, linkX + 5, pageHeight - 15); // Place the link next to the bottomText

    // Add the actual clickable link (adjust positioning to match the text link)
    doc.link(linkX, pageHeight - 30, doc.getTextWidth(githubLink), 10, { url: 'https://github.com/synlock' });
}


